    <script>
        const data = {
            'astronaut_1': {
                'scale': 0.2,
                'rotation': 0,
                'height': 1501.3,
                'width': 952,
                'interfaces': {
                    "1": [937, (25 + 65) / 2] 
                },
                'endpoint': true,
            },
            'astronaut_2': {
                'scale': 0.2,
                'rotation': 0,
                'height': 952,
                'width': 1501.3,
                'interfaces': {
                    "2": [937, 1501.3 -(25 + 65) / 2] 
                },
                'endpoint': true,
            },
            'astronaut_3': {
                'scale': 0.2,
                'rotation': 0,
                'height': 1501.3,
                'width': 952,
                'interfaces': {
                    "3": [15, 1501.3 - (25 + 65) / 2] 
                },
                'endpoint': true,
            },
            'body_1': {
                'scale': 0.5,
                'rotation': 0,
                'width': 758.67,
                'height': 486.67,
                'interfaces': {
                    "1": [690, (30 + 450)/2],
                    "3": [100, (15 + 460)/2] 
                },
                'endpoint': false,
            },
            'body_2': {
                'scale': 0.4,
                'rotation': 0,
                'width': 709.33,
                'height': 797.33,
                'interfaces': {
                    "1": [580, (110 + 770) / 2],
                    "3": [90, (120 + 705) /2] 
                },
                'endpoint': false,
            },
            'body_3': {
                'scale': 0.4,
                'rotation': 0,
                'width': 1045.3,
                'height': 694.67,
                'interfaces': {
                    "1": [960, (170 + 620)/2],
                    "3": [130, (210 + 640)/2] 
                },
                'endpoint': false,
            }

        }
        for (const [key, val] of Object.entries(data)){
            //console.log(key)
            let path = document.getElementById(key)
            path.setAttribute('visibility',"hidden")
                        
        }
        
        
        var svg = document.getElementById("drawing")
        
        function drawhorline(xpos){
            var line = document.createElementNS('http://www.w3.org/2000/svg','line');
            line.setAttribute('x1', xpos)
            line.setAttribute('x2', xpos)
            line.setAttribute('y1', 0)
            line.setAttribute('y2', 900)
            svg.append(line)
        }
        function drawverline(ypos){
            var line = document.createElementNS('http://www.w3.org/2000/svg','line');
            line.setAttribute('x1', 0)
            line.setAttribute('x2', 1500)
            line.setAttribute('y1', ypos)
            line.setAttribute('y2', ypos)
            svg.append(line)
        }
        function drawcircle(position){
            var circle = document.createElementNS('http://www.w3.org/2000/svg','circle');
            circle.setAttribute('cx', position.x)
            circle.setAttribute('cy', position.y)
            circle.setAttribute('r', 10)
            svg.append(circle)
        }

        var remaining_objects = Object.keys(data).filter(key => !data[key].endpoint)
        var remaining_endpoints = Object.keys(data).filter(key => data[key].endpoint)
        
        var position = {x: 200, y: 450}
        var first = true
        var endpointposition = null
        while(remaining_objects.length > 0){
            let random_key = remaining_objects[ remaining_objects.length * Math.random() << 0]
            let path = document.getElementById(random_key)
            svg.removeChild(path)
            let random_data = data[random_key]
            if(first){
                endpointposition = {x: position.x, y: position.y}
                first = false
            }
            position.x = position.x - random_data.interfaces["3"][0] * random_data.scale
            position.y = position.y - random_data.interfaces["3"][1] * random_data.scale
            
            console.log(endpointposition, first)
            
            path.setAttribute('transform', `translate(${position.x} ${position.y}) scale(${random_data.scale}) rotate(${random_data.rotation} ${random_data.width/2} ${random_data.height/2})`)
            position.x = position.x + random_data.interfaces["1"][0] * random_data.scale
            position.y = position.y + random_data.interfaces["1"][1] * random_data.scale
            path.setAttribute('visibility', "visible")
            svg.prepend(path)

            remaining_objects = remaining_objects.filter(element =>  element != random_key)
            if (remaining_objects.length === 0){
                if(Math.random() > 0.5){
                    // astronaut at end
                    random_key = remaining_endpoints[2]
                    path = document.getElementById(random_key)
                    svg.removeChild(path)
                    random_data = data[random_key]
                                    
                    position.x = position.x - random_data.interfaces["3"][0] * random_data.scale
                    position.y = position.y - random_data.interfaces["3"][1] * random_data.scale
                    
                    path.setAttribute('transform', `translate(${position.x} ${position.y}) scale(${random_data.scale}) rotate(${random_data.rotation} ${random_data.width/2} ${random_data.height/2}) `)
                    path.setAttribute('visibility', "visible")
                    svg.prepend(path)
                }else{
                    // astronaut at start
                    random_key = remaining_endpoints[0]
                    path = document.getElementById(random_key)
                    svg.removeChild(path)
                    random_data = data[random_key]
                    position = endpointposition
                    
                    position.x = position.x - random_data.interfaces["1"][0] * random_data.scale
                    position.y = position.y - random_data.interfaces["1"][1] * random_data.scale
                    
                    path.setAttribute('transform', `translate(${position.x} ${position.y}) scale(${random_data.scale}) rotate(${random_data.rotation} ${random_data.width/2} ${random_data.height/2}) `)
                    path.setAttribute('visibility', "visible")
                    svg.append(path)
                }
                
                
                
            }
        }


        
    </script>
